import Card from "../components/Card/Card";

import React from "react";


function Orders(){

 return (
    <div className="content">
        <div className="titleAndSearch">
             <h1>Мои заказы</h1>
        </div>
    <div className="cards">
    {[].map((item,index) => (
            <Card
              key = {item.title}
              id = {item.id}
              hash = {item.hash}
              title={item.title}
              imgURL={item.imgURL}
              description={item.description}
              price={item.price}
              favorited = {true}
              //onFavorite = {onAddToFavorite}
            ></Card>
          ))}
    </div>
  </div>
 );   
}
export default Orders;
